"use strict";(globalThis.webpackChunktiennhm_github_io=globalThis.webpackChunktiennhm_github_io||[]).push([[34649],{1952:i=>{i.exports=JSON.parse('{"tag":{"label":"aws-certification","permalink":"/docs/tags/aws-certification","allTagsPath":"/docs/tags","count":32,"items":[{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/introduction-to-the-cloud","title":"M01.01 - Introduction to the Cloud","description":"Kh\xe1m ph\xe1 n\u1ec1n t\u1ea3ng c\u1ee7a Cloud Computing v\u1edbi AWS Cloud Practitioner Essentials Module 1. T\xecm hi\u1ec3u \u0111\u1ecbnh ngh\u0129a Cloud Computing, l\u1ecbch s\u1eed h\xecnh th\xe0nh AWS, c\xe1c lo\u1ea1i cloud deployment (Cloud, On-premises, Hybrid), v\xe0 c\xe1c kh\xe1i ni\u1ec7m c\u01a1 b\u1ea3n v\u1ec1 on-demand delivery, IT resources, pay-as-you-go pricing.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/introduction-to-the-cloud"},{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/benefits-of-the-aws-cloud","title":"M01.02 - Benefits of the AWS Cloud","description":"Kh\xe1m ph\xe1 6 l\u1ee3i \xedch ch\xednh c\u1ee7a AWS Cloud - Trade fixed expense for variable expense, Benefit from massive economies of scale, Stop guessing capacity, Increase speed and agility, Stop spending money to run and maintain data centers, v\xe0 Go global in minutes.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/benefits-of-the-aws-cloud"},{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/introduction-to-aws-global-infrastructure","title":"M01.03 - Introduction to AWS Global Infrastructure","description":"T\xecm hi\u1ec3u v\u1ec1 AWS Global Infrastructure, bao g\u1ed3m AWS Regions v\xe0 Availability Zones. Kh\xe1m ph\xe1 c\xe1c l\u1ee3i \xedch c\u1ee7a high availability v\xe0 fault tolerance, v\xe0 c\xe1ch AWS thi\u1ebft k\u1ebf h\u1ea1 t\u1ea7ng \u0111\u1ec3 \u0111\u1ea3m b\u1ea3o \u1ee9ng d\u1ee5ng lu\xf4n ho\u1ea1t \u0111\u1ed9ng.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/introduction-to-aws-global-infrastructure"},{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/shared-responsibility-model","title":"M01.04 - The AWS Shared Responsibility Model","description":"T\xecm hi\u1ec3u v\u1ec1 AWS Shared Responsibility Model - m\xf4 h\xecnh tr\xe1ch nhi\u1ec7m chia s\u1ebb gi\u1eefa AWS v\xe0 kh\xe1ch h\xe0ng. Ph\xe2n bi\u1ec7t r\xf5 tr\xe1ch nhi\u1ec7m c\u1ee7a kh\xe1ch h\xe0ng, tr\xe1ch nhi\u1ec7m c\u1ee7a AWS, v\xe0 tr\xe1ch nhi\u1ec7m \u0111\u01b0\u1ee3c chia s\u1ebb trong AWS Cloud.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/shared-responsibility-model"},{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/applying-cloud-concepts-to-real-life-use-cases","title":"M01.05 - Applying Cloud Concepts to Real Life Use Cases","description":"Kh\xe1m ph\xe1 c\xe1ch c\xe1c kh\xe1i ni\u1ec7m cloud c\u01a1 b\u1ea3n nh\u01b0 AWS Global Infrastructure v\xe0 AWS Shared Responsibility Model ho\u1ea1t \u0111\u1ed9ng c\xf9ng nhau \u0111\u1ec3 t\u1ea1o ra c\xe1c gi\u1ea3i ph\xe1p kinh doanh th\u1ef1c t\u1ebf. T\xecm hi\u1ec3u qua v\xed d\u1ee5 v\u1ec1 c\xf4ng ty e-commerce m\u1edf r\u1ed9ng to\xe0n c\u1ea7u.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/applying-cloud-concepts-to-real-life-use-cases"},{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/module-1-assessment","title":"M01.06 - Module 1 Assessment","description":"B\xe0i ki\u1ec3m tra Module 1 - Introduction to the Cloud. B\u1ea1n ph\u1ea3i \u0111\u1ea1t 80% tr\u1edf l\xean \u0111\u1ec3 v\u01b0\u1ee3t qua module n\xe0y. B\u1ea1n c\xf3 th\u1ec3 l\xe0m l\u1ea1i kh\xf4ng gi\u1edbi h\u1ea1n s\u1ed1 l\u1ea7n.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/module-1-assessment"},{"id":"aws-cloud-practitioner-essentials/introduction-to-the-cloud/module-1-summary","title":"M01.07 - Module 1 Summary","description":"T\u1ed5ng k\u1ebft Module 1 - Introduction to the Cloud. \xd4n t\u1eadp l\u1ea1i c\xe1c kh\xe1i ni\u1ec7m c\u01a1 b\u1ea3n v\u1ec1 cloud computing, AWS Global Infrastructure, v\xe0 AWS Shared Responsibility Model. T\xecm hi\u1ec3u c\xe1c b\u01b0\u1edbc ti\u1ebfp theo v\xe0 t\xe0i nguy\xean h\u1ecdc t\u1eadp.","permalink":"/docs/aws-cloud-practitioner-essentials/introduction-to-the-cloud/module-1-summary"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/introduction-to-amazon-ec2","title":"M02.01 - Introduction to Amazon EC2","description":"T\xecm hi\u1ec3u v\u1ec1 Amazon Elastic Compute Cloud (EC2) - d\u1ecbch v\u1ee5 compute m\u1ea1nh m\u1ebd c\u1ee7a AWS. Kh\xe1m ph\xe1 c\xe1ch provision v\xe0 qu\u1ea3n l\xfd virtual servers, so s\xe1nh l\u1ee3i \xedch c\u1ee7a cloud v\u1edbi on-premises, v\xe0 kh\xe1i ni\u1ec7m multi-tenancy trong EC2.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/introduction-to-amazon-ec2"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/amazon-ec2-instance-types","title":"M02.02 - Amazon EC2 Instance Types","description":"T\xecm hi\u1ec3u v\u1ec1 c\xe1c lo\u1ea1i EC2 instance types kh\xe1c nhau v\xe0 \u0111\u1eb7c \u0111i\u1ec3m c\u1ee7a ch\xfang. X\xe1c \u0111\u1ecbnh c\xe1c use cases ph\xf9 h\u1ee3p cho t\u1eebng lo\u1ea1i EC2 instance type - General Purpose, Compute Optimized, Memory Optimized, Accelerated Computing, v\xe0 Storage Optimized.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/amazon-ec2-instance-types"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/how-to-provision-aws-resources","title":"M02.03 - How to Provision AWS Resources","description":"T\xecm hi\u1ec3u c\xe1ch s\u1eed d\u1ee5ng AWS Management Console, AWS CLI v\xe0 AWS SDK \u0111\u1ec3 t\u01b0\u01a1ng t\xe1c v\u1edbi AWS services. M\xf4 t\u1ea3 tr\xe1ch nhi\u1ec7m c\u1ee7a kh\xe1ch h\xe0ng v\xe0 AWS \u0111\u1ed1i v\u1edbi virtual machines, v\xe0 gi\u1ea3i th\xedch s\u1ef1 kh\xe1c bi\u1ec7t gi\u1eefa managed v\xe0 unmanaged services.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/how-to-provision-aws-resources"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/demo-launching-an-amazon-ec2-instance","title":"M02.04 - Demo Launching an Amazon EC2 Instance","description":"T\xecm hi\u1ec3u c\xe1c c\u1ea5u h\xecnh ch\xednh c\u1ea7n thi\u1ebft khi thi\u1ebft l\u1eadp EC2 instance. Gi\u1ea3i th\xedch c\xe1ch AMI duy tr\xec t\xednh nh\u1ea5t qu\xe1n v\xe0 hi\u1ec7u qu\u1ea3 khi scale applications. Demo th\u1ef1c t\u1ebf v\u1ec1 c\xe1ch launch m\u1ed9t EC2 instance.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/demo-launching-an-amazon-ec2-instance"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/amazon-ec2-pricing","title":"M02.05 - Amazon EC2 Pricing","description":"T\xecm hi\u1ec3u v\u1ec1 c\xe1c t\xf9y ch\u1ecdn pricing c\u1ee7a Amazon EC2: On-Demand, Reserved Instances, Spot Instances, Savings Plans, Dedicated Hosts, v\xe0 Capacity Reservations. M\xf4 t\u1ea3 khi n\xe0o s\u1eed d\u1ee5ng m\u1ed7i t\xf9y ch\u1ecdn pricing d\u1ef1a tr\xean use cases c\u1ee5 th\u1ec3.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/amazon-ec2-pricing"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/scaling-amazon-ec2","title":"M02.06 - Scaling Amazon EC2","description":"T\xecm hi\u1ec3u v\u1ec1 scalability v\xe0 elasticity trong AWS, c\xe1ch scale Amazon EC2 instances, v\xe0 Amazon EC2 Auto Scaling. Kh\xe1m ph\xe1 c\xe1c kh\xe1i ni\u1ec7m v\u1ec1 scaling up vs scaling out, Auto Scaling groups v\u1edbi minimum, desired v\xe0 maximum capacity, v\xe0 c\xe1ch AWS gi\xfap businesses \u0111i\u1ec1u ch\u1ec9nh compute capacity d\u1ef1a tr\xean demand.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/scaling-amazon-ec2"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/directing-traffic-with-elastic-load-balancing","title":"M02.07 - Directing Traffic with Elastic Load Balancing","description":"T\xecm hi\u1ec3u v\u1ec1 Elastic Load Balancing (ELB) trong AWS, c\xe1ch ELB ph\xe2n ph\u1ed1i traffic, c\xe1c routing methods, v\xe0 m\u1ed1i quan h\u1ec7 gi\u1eefa ELB v\xe0 Amazon EC2 Auto Scaling. Kh\xe1m ph\xe1 c\xe1c l\u1ee3i \xedch c\u1ee7a ELB trong vi\u1ec7c c\u1ea3i thi\u1ec7n scalability v\xe0 high availability.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/directing-traffic-with-elastic-load-balancing"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/messaging-and-queuing","title":"M02.08 - Messaging and Queuing","description":"T\xecm hi\u1ec3u v\u1ec1 messaging v\xe0 queuing trong AWS, bao g\u1ed3m Amazon SQS, Amazon SNS v\xe0 Amazon EventBridge. Kh\xe1m ph\xe1 s\u1ef1 kh\xe1c bi\u1ec7t gi\u1eefa tightly coupled v\xe0 loosely coupled architectures, v\xe0 c\xe1ch message queues gi\xfap c\u1ea3i thi\u1ec7n communication gi\u1eefa c\xe1c components.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/messaging-and-queuing"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/module-2-assessment","title":"M02.09 - Module 2 Assessment","description":"B\xe0i ki\u1ec3m tra Module 2 - Compute in the Cloud. B\u1ea1n ph\u1ea3i \u0111\u1ea1t 80% tr\u1edf l\xean \u0111\u1ec3 v\u01b0\u1ee3t qua module n\xe0y. B\u1ea1n c\xf3 th\u1ec3 l\xe0m l\u1ea1i kh\xf4ng gi\u1edbi h\u1ea1n s\u1ed1 l\u1ea7n.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/module-2-assessment"},{"id":"aws-cloud-practitioner-essentials/compute-in-the-cloud/module-2-summary","title":"M02.10 - Module 2 Summary","description":"T\u1ed5ng k\u1ebft Module 2 - Compute in the Cloud. \xd4n t\u1eadp l\u1ea1i c\xe1c kh\xe1i ni\u1ec7m v\u1ec1 Amazon EC2, EC2 instance types, pricing, Auto Scaling, Load Balancing, v\xe0 messaging services. T\xecm hi\u1ec3u c\xe1c b\u01b0\u1edbc ti\u1ebfp theo v\xe0 t\xe0i nguy\xean h\u1ecdc t\u1eadp.","permalink":"/docs/aws-cloud-practitioner-essentials/compute-in-the-cloud/module-2-summary"},{"id":"aws-cloud-practitioner-essentials/exploring-compute-services/introduction-to-serverless-computing","title":"M03.01 - Introduction to Serverless Computing","description":"T\xecm hi\u1ec3u v\u1ec1 serverless computing v\xe0 s\u1ef1 kh\xe1c bi\u1ec7t gi\u1eefa unmanaged, managed, v\xe0 serverless compute services trong AWS. Kh\xe1m ph\xe1 tr\xe1ch nhi\u1ec7m c\u1ee7a kh\xe1ch h\xe0ng v\xe0 AWS \u0111\u1ed1i v\u1edbi serverless computing.","permalink":"/docs/aws-cloud-practitioner-essentials/exploring-compute-services/introduction-to-serverless-computing"},{"id":"aws-cloud-practitioner-essentials/exploring-compute-services/aws-lambda","title":"M03.02 - AWS Lambda","description":"T\xecm hi\u1ec3u v\u1ec1 AWS Lambda - serverless compute service ch\u1ea1y code m\xe0 kh\xf4ng c\u1ea7n qu\u1ea3n l\xfd servers. Kh\xe1m ph\xe1 c\xe1c th\xe0nh ph\u1ea7n ch\xednh c\u1ee7a Lambda nh\u01b0 triggers, functions, scaling, v\xe0 c\xe1c use cases th\u1ef1c t\u1ebf.","permalink":"/docs/aws-cloud-practitioner-essentials/exploring-compute-services/aws-lambda"},{"id":"aws-cloud-practitioner-essentials/exploring-compute-services/containers-and-orchestration-on-aws","title":"M03.03 - Containers and Orchestration on AWS","description":"T\xecm hi\u1ec3u v\u1ec1 containers v\xe0 orchestration tr\xean AWS. Kh\xe1m ph\xe1 c\xe1ch containers t\u1ea1o m\xf4i tr\u01b0\u1eddng runtime nh\u1ea5t qu\xe1n v\xe0 portable, Amazon ECR \u0111\u1ec3 l\u01b0u tr\u1eef container images, Amazon ECS v\xe0 Amazon EKS \u0111\u1ec3 orchestrate containers, v\xe0 AWS Fargate \u0111\u1ec3 ch\u1ea1y containers serverless.","permalink":"/docs/aws-cloud-practitioner-essentials/exploring-compute-services/containers-and-orchestration-on-aws"},{"id":"aws-cloud-practitioner-essentials/exploring-compute-services/additional-compute-services","title":"M03.04 - Additional Compute Services","description":"T\xecm hi\u1ec3u v\u1ec1 c\xe1c compute services b\u1ed5 sung c\u1ee7a AWS: Elastic Beanstalk, AWS Batch, Amazon Lightsail, v\xe0 AWS Outposts. Kh\xe1m ph\xe1 c\xe1ch c\xe1c services n\xe0y streamlines deployment, batch processing, web hosting, v\xe0 hybrid cloud architectures.","permalink":"/docs/aws-cloud-practitioner-essentials/exploring-compute-services/additional-compute-services"},{"id":"aws-cloud-practitioner-essentials/exploring-compute-services/module-3-assessment","title":"M03.05 - Module 3 Assessment","description":"B\xe0i ki\u1ec3m tra Module 3 - Exploring Compute Services. B\u1ea1n ph\u1ea3i \u0111\u1ea1t 80% tr\u1edf l\xean \u0111\u1ec3 v\u01b0\u1ee3t qua module n\xe0y. B\u1ea1n c\xf3 th\u1ec3 l\xe0m l\u1ea1i kh\xf4ng gi\u1edbi h\u1ea1n s\u1ed1 l\u1ea7n.","permalink":"/docs/aws-cloud-practitioner-essentials/exploring-compute-services/module-3-assessment"},{"id":"aws-cloud-practitioner-essentials/exploring-compute-services/module-3-summary","title":"M03.06 - Module 3 Summary","description":"T\u1ed5ng k\u1ebft Module 3 - Exploring Compute Services. \xd4n t\u1eadp l\u1ea1i c\xe1c kh\xe1i ni\u1ec7m v\u1ec1 serverless computing, AWS Lambda, containers, orchestration services, v\xe0 c\xe1c additional compute services. T\xecm hi\u1ec3u c\xe1c b\u01b0\u1edbc ti\u1ebfp theo v\xe0 t\xe0i nguy\xean h\u1ecdc t\u1eadp.","permalink":"/docs/aws-cloud-practitioner-essentials/exploring-compute-services/module-3-summary"},{"id":"aws-cloud-practitioner-essentials/going-global/introduction-to-going-global","title":"M04.01 - Introduction to Going Global","description":"Gi\u1edbi thi\u1ec7u v\u1ec1 AWS Global Infrastructure v\xe0 c\xe1c kh\xe1i ni\u1ec7m c\u01a1 b\u1ea3n v\u1ec1 going global. T\xecm hi\u1ec3u c\xe1ch ch\u1ecdn AWS Regions, gi\xe1 tr\u1ecb c\u1ee7a edge locations, v\xe0 c\xe1ch s\u1eed d\u1ee5ng AWS CloudFormation \u0111\u1ec3 streamline v\xe0 automate deployment.","permalink":"/docs/aws-cloud-practitioner-essentials/going-global/introduction-to-going-global"},{"id":"aws-cloud-practitioner-essentials/going-global/choosing-aws-regions","title":"M04.02 - Choosing AWS Regions","description":"T\xecm hi\u1ec3u c\xe1ch ch\u1ecdn AWS Region ph\xf9 h\u1ee3p cho business needs c\u1ee7a b\u1ea1n. Kh\xe1m ph\xe1 4 y\u1ebfu t\u1ed1 ch\xednh: Compliance, Proximity, Feature availability, v\xe0 Pricing. Hi\u1ec3u v\u1ec1 data isolation v\xe0 regulatory requirements khi ch\u1ecdn Regions.","permalink":"/docs/aws-cloud-practitioner-essentials/going-global/choosing-aws-regions"},{"id":"aws-cloud-practitioner-essentials/going-global/diving-deeper-into-aws-global-infrastructure","title":"M04.03 - Diving Deeper into AWS Global Infrastructure","description":"T\xecm hi\u1ec3u s\xe2u h\u01a1n v\u1ec1 AWS Global Infrastructure, bao g\u1ed3m multi-Region v\xe0 multi-AZ deployments, edge locations, CloudFront, v\xe0 AWS Outposts. Kh\xe1m ph\xe1 m\u1ed1i quan h\u1ec7 gi\u1eefa Regions, Availability Zones, v\xe0 edge locations.","permalink":"/docs/aws-cloud-practitioner-essentials/going-global/diving-deeper-into-aws-global-infrastructure"},{"id":"aws-cloud-practitioner-essentials/going-global/infrastructure-and-automation","title":"M04.04 - Infrastructure and Automation","description":"T\xecm hi\u1ec3u v\u1ec1 Infrastructure as Code (IaC) v\xe0 AWS CloudFormation. Kh\xe1m ph\xe1 c\xe1c c\xe1ch t\u01b0\u01a1ng t\xe1c v\u1edbi AWS resources: Programmatic access, AWS Management Console, v\xe0 Infrastructure as Code. M\xf4 t\u1ea3 key features v\xe0 benefits c\u1ee7a CloudFormation.","permalink":"/docs/aws-cloud-practitioner-essentials/going-global/infrastructure-and-automation"},{"id":"aws-cloud-practitioner-essentials/going-global/module-4-assessment","title":"M04.05 - Module 4 Assessment","description":"B\xe0i ki\u1ec3m tra Module 4 - Going Global. B\u1ea1n ph\u1ea3i \u0111\u1ea1t 80% tr\u1edf l\xean \u0111\u1ec3 v\u01b0\u1ee3t qua module n\xe0y. B\u1ea1n c\xf3 th\u1ec3 l\xe0m l\u1ea1i kh\xf4ng gi\u1edbi h\u1ea1n s\u1ed1 l\u1ea7n.","permalink":"/docs/aws-cloud-practitioner-essentials/going-global/module-4-assessment"},{"id":"aws-cloud-practitioner-essentials/going-global/module-4-summary","title":"M04.06 - Module 4 Summary","description":"T\u1ed5ng k\u1ebft Module 4 - Going Global. \xd4n t\u1eadp l\u1ea1i c\xe1c kh\xe1i ni\u1ec7m v\u1ec1 AWS Global Infrastructure, c\xe1ch ch\u1ecdn AWS Regions, edge locations, v\xe0 Infrastructure as Code v\u1edbi AWS CloudFormation. T\xecm hi\u1ec3u c\xe1c b\u01b0\u1edbc ti\u1ebfp theo v\xe0 t\xe0i nguy\xean h\u1ecdc t\u1eadp.","permalink":"/docs/aws-cloud-practitioner-essentials/going-global/module-4-summary"},{"id":"aws-cloud-practitioner-essentials/networking/introduction-to-networking","title":"M05.01 - Introduction to Networking","description":"Gi\u1edbi thi\u1ec7u v\u1ec1 AWS Networking, bao g\u1ed3m Amazon Virtual Private Cloud (VPC), Subnets, v\xe0 s\u1ef1 kh\xe1c bi\u1ec7t gi\u1eefa public v\xe0 private subnets. T\xecm hi\u1ec3u v\u1ec1 network diagrams v\xe0 c\xe1ch t\u1ed5 ch\u1ee9c resources trong AWS Cloud.","permalink":"/docs/aws-cloud-practitioner-essentials/networking/introduction-to-networking"},{"id":"aws-cloud-practitioner-essentials/networking/organizing-aws-cloud-resources","title":"M05.02 - Organizing AWS Cloud Resources","description":"T\xecm hi\u1ec3u c\xe1ch t\u1ed5 ch\u1ee9c resources trong AWS Cloud v\u1edbi Amazon VPC, Internet Gateway, Virtual Private Gateway, v\xe0 VPN connections. Kh\xe1m ph\xe1 benefits c\u1ee7a VPC v\xe0 c\xe1ch thi\u1ebft l\u1eadp boundaries cho resources.","permalink":"/docs/aws-cloud-practitioner-essentials/networking/organizing-aws-cloud-resources"},{"id":"aws-cloud-practitioner-essentials/networking/more-ways-to-connect-to-the-aws-cloud","title":"M05.03 - More Ways to Connect to the AWS Cloud","description":"Kh\xe1m ph\xe1 c\xe1c c\xe1ch k\u1ebft n\u1ed1i hybrid cloud v\u1edbi AWS Cloud: AWS Client VPN, AWS Site-to-Site VPN, AWS PrivateLink, v\xe0 AWS Direct Connect. T\xecm hi\u1ec3u v\u1ec1 c\xe1c gateway services b\u1ed5 sung nh\u01b0 Transit Gateway, NAT Gateway, v\xe0 API Gateway.","permalink":"/docs/aws-cloud-practitioner-essentials/networking/more-ways-to-connect-to-the-aws-cloud"}],"unlisted":false}}')}}]);